import { StyleSheet } from 'react-native';

const subwayScreenStyles = StyleSheet.create({
    backgroundImage: {
        width: 375,
        height: 750,
    },

    subwayScreenTitle: {
        marginTop: 100,
        marginLeft: 25,
        color: "white",
        fontWeight: "bold",
    },

    emptyText: {
        paddingBottom: 25,
    },

    backButton: {
        paddingBottom:50,
    },

});

export { subwayScreenStyles }
